	(37, 'nginx.conf', 'nginx.conf=nginx.conf=#user  nobody;\nworker_processes  2;\nworker_cpu_affinity 01 10;\nworker_rlimit_nofile 65535;\n\nevents {\n    worker_connections  10240;\n    use epoll;\n}\n\nhttp {\n    include       mime.types;\n    default_type  application/octet-stream;\n    proxy_headers_hash_max_size 51200;\n    proxy_headers_hash_bucket_size 6400;\n    \n    map $http_cdn_src_ip $clientip {\n        default $remote_addr;\n        ~\\d+.*  $http_cdn_src_ip;\n    }\n        proxy_set_header Host             $host:7038;\n        proxy_set_header X-Real-IP        $clientip;\n        proxy_set_header X-Forwarded-for  $clientip;\n        proxy_set_header X-Forwarded-for  $proxy_add_x_forwarded_for;\n\n  log_format  main  \'$remote_addr - $remote_user [$time_local] "$request" \'\n                      \'$status $body_bytes_sent "$http_referer" \'\n                      \'"$http_user_agent" "$http_x_forwarded_for"\'\n                      \'$upstream_addr\';\n\n      ##cache##\n  proxy_connect_timeout 20;\n  proxy_read_timeout 60;\n  proxy_send_timeout 60;\n  proxy_buffer_size 16k;\n  proxy_buffers 4 1024k;\n  proxy_busy_buffers_size 1024k;\n  proxy_http_version 1.1;\n  ##end##\n\n    access_log  logs/access.log  main;\n\n    client_body_timeout   10;\n    client_header_timeout  100;\n\n    keepalive_timeout     65;\n    tcp_nopush     on;\n    tcp_nodelay    on;\n    sendfile        on;\n \nupstream uiserver {\n             ip_hash;\n             server 10.126.3.164:7000 max_fails=3 fail_timeout=10s;\n             server 10.126.3.164:7026 max_fails=3 fail_timeout=10s;\n             #sticky expires=2h;\n}\n\nupstream masterserver { \n           server 10.126.3.164:7010 max_fails=3 fail_timeout=10s;\n	   server 10.126.3.164:7027 max_fails=3 fail_timeout=10s;\n } \n\nupstream svnserver { \n           server 10.126.3.164:7011 max_fails=3 fail_timeout=10s;\n	   server 10.126.3.164:7028 max_fails=3 fail_timeout=10s;\n} \n\nupstream adapterserver { \n             server 10.126.3.164:7012 max_fails=3 fail_timeout=10s;\n	     server 10.126.3.164:7029 max_fails=3 fail_timeout=10s;\n    	} \n\nupstream appserver {\n               server 10.126.3.164:7017 max_fails=3 fail_timeout=10s;\n               server 10.126.3.164:7032 max_fails=3 fail_timeout=10s;\n               keepalive 32;\n}\n\n  server {\n        listen       8088;\n        server_name  localhost;\n        client_body_buffer_size  16K;\n        client_header_buffer_size  1k;\n        client_max_body_size  20m;\n        large_client_header_buffers  4  8k;\n        if ($request_method !~ ^(GET|HEAD|POST|DELETE|PUT)$) {\n                return 404;\n        }\n\nlocation /cloudui{\n#           proxy_set_header        Host $host;\n             proxy_set_header        Host $host:7038;\n             max_ranges         120;\n             #add_header Accept-Ranges \'\';\n             proxy_set_header Range $http_range;\n             proxy_set_header        X-Real-IP $remote_addr;\n             proxy_set_header        X-Forwarded-For $proxy_add_x_forwarded_for;\n             proxy_set_header   Cookie $http_cookie;\n             proxy_pass http://uiserver$request_uri;\n         #  access_log  logs/cloudui_access.log  main;\n}\n\n location /masterl/ {     \n           proxy_set_header        Host $host;\n           proxy_set_header        X-Real-IP $remote_addr;\n           proxy_set_header        X-Forwarded-For $proxy_add_x_forwarded_for; \n	   proxy_pass http://masterserver;\n}\n\n\nlocation /svn/ { \n           proxy_set_header        Host $host;\n           proxy_set_header        X-Real-IP $remote_addr;\n           proxy_set_header        X-Forwarded-For $proxy_add_x_forwarded_for; \n	   proxy_pass http://svnserver;\n}\n\n\nlocation /Adapter/ {     \n             proxy_set_header        Host $host;\n             proxy_set_header        X-Real-IP $remote_addr;\n             proxy_set_header        X-Forwarded-For $proxy_add_x_forwarded_for; \n	     proxy_pass http://adapterserver;\n  	  	}\n\n\nlocation / {\n               proxy_set_header        Host $host;\n               proxy_set_header        X-Real-IP $remote_addr;\n               proxy_set_header        X-Forwarded-For $proxy_add_x_forwarded_for;\n               proxy_pass http://appserver;\n               proxy_http_version 1.1;\n               proxy_set_header Connection ""; \n}\n\n}\n}', 'nginx', 'normal', 1, 'nginx.conf文件内容', 0),
